; ---------------------------------------------------------------------------
; WAIT_VBL
 macro WAIT_VBL
                ld b, hi(PPI_B)
@wait           
                in a, (c)
                rra
                jr nc, @wait
 endm



macro SET_COLOR pen, ink
                ld bc, GATE_ARRAY | PENR | {pen}
                out (c), c
                ld c, {ink}
                out (c), c
endm

macro SET_COLOR_a pen
                ld bc, GATE_ARRAY | PENR | {pen}
                out (c), c
                out (c), a
endm


macro SET_BORDER ink 
                SET_COLOR #10, {ink}
endm

macro SET_MODE mode 
                LD bc, GATE_ARRAY | RMR | ROM_OFF | {mode}
                out (c), c
                print "Mode :", {hex}GATE_ARRAY | RMR | ROM_OFF | {mode}
endm

             
macro SET_PALETTE palette, start, length
                ld a, {start}
                ld c, {length}
                ld hl, {palette}
                ld b, hi(GATE_ARRAY)
@loop:
                out (c), a
                inc b
                outi
                inc a
                dec c
                jr nz, @loop
endm

macro ADD_____BC_A                    ;; 5c

                add             a, c
                ld              c, a
                jr              nc, $ + 3
                inc             b
endm



macro ADD_____HL_A                    ;; 5c

                add             a, l
                ld              l, a
                jr              nc, $ + 3
                inc             h
endm

; ---------------------------------------------------------------------------
; WRITE_CRTC
MACRO WRITE_CRTC reg, val
                ld bc, CRTC_SELECT + {reg}
                ld a, {val}
                out (c), c
                inc b
                out (c), a
