-- Project 188: program391 by gurneyh
DO $$
DECLARE
  project_uuid uuid := gen_random_uuid();
  tag_uuid uuid;
BEGIN
  INSERT INTO projects (id, user_id, name, description, visibility, is_library, is_sticky, created_at, updated_at)
  VALUES (
    project_uuid,
    'bd6a166d-e0bf-4374-94c3-5222e517d75c'::uuid,
    'program391',
    'Imported from z80Code. Author: gurneyh.',
    'public',
    false,
    false,
    '2024-09-01T09:41:46.472000'::timestamptz,
    '2024-09-01T09:41:46.479000'::timestamptz
  );

  INSERT INTO project_files (project_id, name, content, is_main, "order")
  VALUES (
    project_uuid,
    'main.asm',
    '; Cration et excution d''une ligne BASIC en asm
; memory &3fff: load"-run.bin",&4000:call &4000
; list
            
            
            
            org #4000  ; adresse o le programme machine est charg en mmoire

start:
            ld hl, basic_start
            ld de, #170 ; adresse de dbut du programme basic
            ld bc, basic_end - basic_start
            ldir


            ; lancer l''interprteur basic
            ; https://cpcrulez.fr/coding_wacci103-rom-a_guide_to_eproms_on_the_cpc.htm
            ld c,#00 ;point to rom 0
            call #b90f ;enable the rom at position 0 (basic)
            ld hl,#00b0 ;put &00b0 in register hl - why?
            ld (hl),#00;store &00 in the addr pointed to by hl why?
            jp #ea78 ;where basic''s run command is stored in the basic rom



basic_start
; ---- ligne 10: print "hello" ----
dw 13   ; longueur totale de la ligne (2 octets pour longueur + 2 octets pour numro + 9 pour print + chane + #00)
dw 10   ; numroe de ligne basic
db #bf  ; token pour print
db 34   ; caractre " (ascii 34)
db ''hello''
db 34   ; caractre " (ascii 34)
db 0    ; fin de la ligne

dw 00   ; fin du programme basic
basic_end',
    true,
    0
  );

  -- Add z80code tag
  SELECT id INTO tag_uuid FROM tags WHERE name = 'z80code';
  IF tag_uuid IS NOT NULL THEN
    INSERT INTO project_tags (project_id, tag_id) VALUES (project_uuid, tag_uuid);
  END IF;
END $$;
